import React from "react";

function Game() {
  return (
    <div className="game">
      <div className="fractalMonster">
        <div className="monsterAvatar"></div>
        <div className="lifebar"></div>
      </div>
      <div className="startButton">
        <button>start</button>
      </div>
      <div className="player"></div>
    </div>
  );
}

export default Game;
